class WeatherModel {
  WeatherModel({
      String? cod,
      int? message, 
      int? cnt,
      List<WeatherList>? weatherList, 
      City? city,}){
    _cod = cod;
    _message = message;
    _cnt = cnt;
    _weatherList = weatherList;
    _city = city;
}

  WeatherModel.fromJson(dynamic json) {
    _cod = json['cod'];
    _message = json['message'];
    _cnt = json['cnt'];
    if (json['weather_list'] != null) {
      _weatherList = [];
      json['weather_list'].forEach((v) {
        _weatherList?.add(WeatherList.fromJson(v));
      });
    }
    _city = json['city'] != null ? City.fromJson(json['city']) : null;
  }
  String? _cod;
  int? _message;
  int? _cnt;
  List<WeatherList>? _weatherList;
  City? _city;
WeatherModel copyWith({  String? cod,
  int? message,
  int? cnt,
  List<WeatherList>? weatherList,
  City? city,
}) => WeatherModel(  cod: cod ?? _cod,
  message: message ?? _message,
  cnt: cnt ?? _cnt,
  weatherList: weatherList ?? _weatherList,
  city: city ?? _city,
);
  String? get cod => _cod;
  int? get message => _message;
  int? get cnt => _cnt;
  List<WeatherList>? get weatherList => _weatherList;
  City? get city => _city;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['cod'] = _cod;
    map['message'] = _message;
    map['cnt'] = _cnt;
    if (_weatherList != null) {
      map['weather_list'] = _weatherList?.map((v) => v.toJson()).toList();
    }
    if (_city != null) {
      map['city'] = _city?.toJson();
    }
    return map;
  }

}